'use strict';

var _feature_catalogue = require('ui/registry/feature_catalogue');

_feature_catalogue.FeatureCatalogueRegistryProvider.register(function ($injector, i18n) {

  var licenseService = $injector.get('logstashLicenseService');
  if (!licenseService.enableLinks) {
    return;
  }

  return {
    id: 'management_logstash',
    title: i18n('xpack.logstash.homeFeature.logstashPipelinesTitle', {
      defaultMessage: 'Logstash Pipelines'
    }),
    description: i18n('xpack.logstash.homeFeature.logstashPipelinesDescription', {
      defaultMessage: 'Create, delete, update, and clone data ingestion pipelines.'
    }),
    icon: 'pipelineApp',
    path: '/app/kibana#/management/logstash/pipelines',
    showOnHomePage: true,
    category: _feature_catalogue.FeatureCatalogueCategory.ADMIN
  };
